-- ----------------------------
-- Table structure for t_app_config
-- ----------------------------
DROP TABLE IF EXISTS `t_app_config`;
CREATE TABLE `t_app_config` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `app_name` varchar(50) NOT NULL COMMENT '应用名称',
  `app_key` varchar(50) NOT NULL COMMENT 'key',
  `app_secret` varchar(50) NOT NULL COMMENT 'secret',
  `app_icon` mediumtext COMMENT '图片',
  `redirect_url` varchar(255) DEFAULT NULL COMMENT '应用url',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新时间',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新日期',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `status` char(2) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

